import React from 'react';
import styled from "styled-components";

function Login() {
  return (
    <Container>Login</Container>
  )
}

const Container=styled.main`
    position: relative;
    height: 100%;
    

    &:before{
        background: url("/images/home-background.png") center center / cover 
        no-repeat fixed;
        content:"";
        position: absolute;
        top:0;
        left:0;
        right:0;
        bottom:0;
        z-index:-1;

    }


`

export default Login
